        (SELECT ID FROM users WHERE ID_Telegram = NEW.id_telegram),
        NEW.Order_ID,
        NEW.Transaksi,
        NEW.Kategori,
        NEW.No_Tiket,
        NEW.Status,
        NEW.progress_order,
        (SELECT Nama FROM users WHERE ID_Telegram = NEW.id_telegram),
        (SELECT role FROM users WHERE ID_Telegram = NEW.id_telegram),
        NEW.order_by,
        NEW.id_telegram,
        NEW.username_telegram,
        (SELECT nama FROM users WHERE ID_Telegram = NEW.id_telegram)
    );
END
$$
